import Header from "./Header";
import Nav from "./Nav";
import Footer from "./Footer";
import { DataProvider } from "./context/DataContext";
import { Outlet } from "react-router-dom";

function App() {
    return (
        <div className="App">
            <Header title="React Blog Posts" />
            <DataProvider>
                <Nav />
                <Outlet />
            </DataProvider>
            <Footer />
        </div>
    );
}

export default App;
